self.addEventListener("notificationclick",function(n){n.waitUntil(clients.openWindow(n.notification.data.url).then(function(){const t=n.notification.data.notificationId,i=n.notification.data.notificationUrl;return fetch(i,{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({notificationId:t})})}))});self.addEventListener("push",function(n){const t=n.data.json().notification,i={body:t.body,icon:t.icon,data:{notificationId:t.data.notificationId,notificationUrl:t.data.notificationUrl,url:t.click_action}};n.waitUntil(self.registration.showNotification(t.title,i))});